import React from 'react'
import fetch from 'isomorphic-unfetch'



export async function getData() {
    const rand = Math.round(Math.random() * (700 - 1) + 1);
    const initialURL = 'https://pokeapi.co/api/v2/pokemon?offset='+rand+'&limit=30';
    return  res = await fetch(initialURL);    
  }

  export async function getStaticProps() {
    const allPostsData = getData()
    return {
      props: {
        allPostsData
      }
    }
  }

  export default function Testpage({allPostsData}){
      return(
          <div>
              {allPostsData.map(({name, url}) => (
                  <li>{name}</li>
              
              ))}
          </div>
      )
  }

